import React from "react";
import { slide as Menu } from "react-burger-menu";
import "../css/BurgerMenu.css";

const toggleMenu = ({ isOpen }) => {};

const BurgerMenu = () => {
  return <Menu noOverlay onStateChange={toggleMenu}></Menu>;
};

export default BurgerMenu;
